import React from "react";
import { Col, Container, Row } from "react-bootstrap";

export default function Footer() {
  return (
    <footer>
      <Container>
        <Row>
          <Col lg={6}>
            <h1>Lets Have a Chat</h1>
          </Col>
        </Row>
      </Container>
    </footer>
  );
}
